class App extends Component {
  state = {};

  render(){
    return(
      <Router>
        <div >
          <Navbar />
          <Jumbotron />
          <Switch>
            <Route exact path="/" component={SearchPage}/>
            <Route exact path="/saved" component={SavedPage}/>
            <Route component={SearchPage}/>
          </Switch>
          {/* {/* <Navbar />
          <Jumbotron />
          <Search />
          <Results /> */}
        </div>
      </Router>

    )
  }
}

export default App;
